import React from 'react'
import CardTemplate from './CardTemplate'
import P from './P'
import SmallContainer from './SmallContainer'
import Input from './Input'
import Button from './Button'
import Tertiary from './Colors'

class Card extends React.Component {
	render() 
	{
		const {id, question, dataEntryId } = this.props;

	return(
		<CardTemplate>
			<SmallContainer background width='200'>

			<P big>{question}</P>	

			<Input></Input>

			<Button color={Tertiary}>Begin Journey</Button>				
			</SmallContainer>
		</CardTemplate>			
	)
	}

}

export default Card;
